const client = new W3CWebSocket('ws://localhost:5000');

function Login() {


    return (<>
    <form methos="POST">
        <input type="email" placeholder='Enter your email' />
        <input type="password" placeholder='Enter your password'/>
        <button>Login</button>
    </form>
    </>);
}

export default Login;
